} // Helper: Match keyword
fun match_keyword(id: String) -> TokenType { match id.to_string() { "fun" => TokenType::Fun, "let" => TokenType::Let, "if" => TokenType::If, "while" => TokenType::While, _ => TokenType::Identifier }
} // Helper: Skip whitespace
fun skip_whitespace(input: String, start: i32) -> i32 { let mut idx = start; loop { let ch = char_at(input, idx); if ch == "\0" || (ch != " " && ch != "\t" && ch != "\n" && ch != "\r") { break; } idx = idx + 1; } idx
} // Tokenize number: "42" -> (Token::Tok(Number, "42"), 2)
fun tokenize_number(input: String, start: i32) -> (Token, i32) { let mut idx = start; let mut num_str = "".to_string(); loop { let ch = char_at(input, idx); if ch == "\0" || !is_digit(ch) { break; } num_str = num_str + ch; idx = idx + 1; } (Token::Tok(TokenType::Number, num_str), idx) // ✅ Works in v3.95.0!
} // Tokenize identifier or keyword
fun tokenize_identifier(input: String, start: i32) -> (Token, i32) { let mut idx = start; let mut id_str = "".to_string(); loop { let ch = char_at(input, idx); if ch == "\0" || (!is_letter(ch) && !is_digit(ch)) { break; } id_str = id_str + ch; idx = idx + 1; } let token_type = match_keyword(id_str.to_string()); (Token::Tok(token_type, id_str), idx)
} // Tokenize single character operators
fun tokenize_single(input: String, start: i32) -> (Token, i32) { let ch = char_at(input, start); if ch == "=" { let next_ch = char_at(input, start + 1); if next_ch == "=" { (Token::Tok(TokenType::EqualEqual, "==".to_string()), start + 2) } else { (Token::Tok(TokenType::Equal, "=".to_string()), start + 1) } } else if ch == "+" { (Token::Tok(TokenType::Plus, "+".to_string()), start + 1) } else if ch == "-" { (Token::Tok(TokenType::Minus, "-".to_string()), start + 1) } else if ch == "*" { (Token::Tok(TokenType::Star, "*".to_string()), start + 1) } else if ch == "/" { // Check for line comment let next_ch = char_at(input, start + 1); if next_ch == "/" { // Skip until newline let mut idx = start + 2; loop { let c = char_at(input, idx); if c == "\0" || c == "\n" { break; } idx = idx + 1; } tokenize_one(input, idx) // Recurse to get next token } else { (Token::Tok(TokenType::Slash, "/".to_string()), start + 1) } } else { (Token::Tok(TokenType::Error, ch.to_string()), start + 1) }
